    };
  }
  render(){
    return( <div>
      <h1>Let`s gooo</h1>
      <p>
        {this.state.age}
      </p>
      <p>
        {this.state.name.map((x)=>{
          return (<li>{x.text}</li>)
        })}
      </p>
    </div>)
  }
}
export default App;
